import React from 'react'
import CategoryComponent from '../Components/'

function TaskCategoryContainer() {

  const renderCategories = () => {
    console.log(this.categories)
    return this.categories.map(category => <CategoryComponent key={category} category={category}/>)
  }


  return (
    <div class="categories">
      <h5>Category filters</h5>
      {renderCategories()}
    </div>
  )
}

export default TaskCategoryContainer
